import React from 'react';
import {BrowserRouter, Route} from "react-router-dom";
import App from "./App";
import Dash from "./Dash";

const Router = () => (
    <BrowserRouter>

        <Route exact path="/" component={App} />
        <Route exact path="/dash" component={Dash} />
    </BrowserRouter>
);

export default  Router;
